import React from "react";
import {
  default as Footer,
  default as Navbar,
} from "./components/navbar/Navbar"; // Adjust the path as necessary
import BusBookingPage from "./pages/BusBookingPage/BusBookingPage";

function App() {
  return (
    <>
      <Navbar />
      <BusBookingPage/>
      <Footer />
    </>
  );
}

export default App;
